  // console.log(props.number);
  // console.log(props.userGoals);
  const goal = (
    <div>
      {props.userGoals.map(ug => {
        return (
          <GoalDetails
            key={ug.id}
            title={ug.title}
            description={ug.description}
            totalTime={ug.duration}
            status={ug.status}
